from weasyprint import HTML
import base64

TEST = ""

def generate_pdf(job: dict, notes: str):
    html_content = f"""
    <!DOCTYPE html>
    <html>
    <head>
        <title>Exemplo PDF</title>
        <style>
            body {{
                font-family: Arial, sans-serif;
                margin: 20px;
            }}
            h1 {{
                color: #333;
            }}
            p {{
                font-size: 14px;
                color: #555;
            }}
            .imagem {{
                max-width: 100%;
                height: auto;
            }}
        </style>
    </head>
    <body>
        <h1>PDF Gerado com WeasyPrint</h1>
        <p>Abaixo está uma imagem codificada em base64:</p>
        <img class="imagem" src="data:image/png;base64,{TEST}" alt="Imagem Base64">
    </body>
    </html>
    """

    print(job.keys())
    pdf_bytes = HTML(string=html_content).write_pdf()
    pdf_base64 = base64.b64encode(pdf_bytes).decode("utf-8")
    return pdf_base64